import React from 'react';
import '../css/login.css';

class Login extends React.Component {
  render() {
    return (
      <div>
        <ul className="userContainer">
          <h3>Login</h3>
          <li>
            <input
              type="email"
              placeholder="Email"
              data-testid="email-input"
            />
          </li>
          <li>
            <input
              type="password"
              placeholder="Senha"
              data-testid="password-input"/>
          </li>
        </ul>
      </div>
    );
  }
}

export default Login;
